import styled from "styled-components";
import { Container, Grid, GridColumn } from "semantic-ui-react";

export const StyledDigit = styled.p`
  &&& {
    font-family: Futura;
    font-style: normal;
    font-weight: 500;
    font-size: 64px;
    line-height: 85px;
    /* identical to box height */

    color: #fcfcfc;

    background: #242424;
    box-shadow: 0px 6px 10px rgba(244, 213, 120, 0.05),
      inset 0px 4px 4px rgba(0, 0, 0, 0.25);
    border-radius: 10px;
    margin-right: 8px;
    width: 72px;
    height: 133px;

    display: flex;
    flex-direction: column;
  }
`;

export const StyledTimeUnit = styled.span`
  &&& {
    font-family: Futura;
    font-style: normal;
    font-weight: 500;
    font-size: 64px;
    line-height: 85px;
    /* identical to box height */
    text-align: center;
    color: #fcfcfc;
  }
`;
